@Component({
  selector: 'app-no-fillings',
  templateUrl: './no-fillings.component.html',
  styleUrls: ['./no-fillings.component.css']
})
export class NoFillingsComponent {

}
<header>
  <div class="topnav">
    <ul>
    <img class="logo-img" href="BreadBasket" src="../assets/Images/logonamu.png"  width="130" height="130" ALIGN=CENTER>
    <li><a routerLink="/sign-in-component">Sign In</a></li>
    <li><a routerLink="/sign-up-component">Sign Up</a></li>
    <li><a routerLink="/with-fillings-component">With Fillings Bread</a></li>
    <li><a routerLink="/no-fillings-component">No Fillings Bread</a></li>
    <li><a class="active" routerLink="/home-component">Home</a></li>
  </ul>
  </div>
